PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `coaches` (
	`id` integer PRIMARY KEY AUTOINCREMENT NOT NULL,
	`name` text NOT NULL,
	`created_at` text DEFAULT 'CURRENT_TIMESTAMP'
, `elo_rating` real DEFAULT 1000 NOT NULL);
CREATE TABLE `divisions` (
	`id` integer PRIMARY KEY AUTOINCREMENT NOT NULL,
	`season_id` integer NOT NULL,
	`name` text NOT NULL, `logo_url` text, display_order INTEGER DEFAULT 0,
	FOREIGN KEY (`season_id`) REFERENCES `seasons`(`id`) ON UPDATE no action ON DELETE no action
);
CREATE TABLE `elo_history` (
	`id` integer PRIMARY KEY AUTOINCREMENT NOT NULL,
	`coach_id` integer NOT NULL,
	`elo_rating` real NOT NULL,
	`match_id` integer,
	`recorded_at` text DEFAULT 'CURRENT_TIMESTAMP',
	FOREIGN KEY (`coach_id`) REFERENCES `coaches`(`id`) ON UPDATE no action ON DELETE no action,
	FOREIGN KEY (`match_id`) REFERENCES `matches`(`id`) ON UPDATE no action ON DELETE no action
);
CREATE TABLE `match_pokemon` (
	`id` integer PRIMARY KEY AUTOINCREMENT NOT NULL,
	`match_id` integer NOT NULL,
	`season_coach_id` integer NOT NULL,
	`pokemon_id` integer NOT NULL,
	`kills` integer DEFAULT 0,
	`deaths` integer DEFAULT 0,
	FOREIGN KEY (`match_id`) REFERENCES `matches`(`id`) ON UPDATE no action ON DELETE no action,
	FOREIGN KEY (`season_coach_id`) REFERENCES `season_coaches`(`id`) ON UPDATE no action ON DELETE no action,
	FOREIGN KEY (`pokemon_id`) REFERENCES `pokemon`(`id`) ON UPDATE no action ON DELETE no action
);
CREATE TABLE `matches` (
	`id` integer PRIMARY KEY AUTOINCREMENT NOT NULL,
	`season_id` integer NOT NULL,
	`division_id` integer NOT NULL,
	`week` integer NOT NULL,
	`coach1_season_id` integer NOT NULL,
	`coach2_season_id` integer NOT NULL,
	`winner_id` integer,
	`coach1_differential` integer DEFAULT 0,
	`coach2_differential` integer DEFAULT 0,
	`is_forfeit` integer DEFAULT false,
	`played_at` text, `replay_url` text,
	FOREIGN KEY (`season_id`) REFERENCES `seasons`(`id`) ON UPDATE no action ON DELETE no action,
	FOREIGN KEY (`division_id`) REFERENCES `divisions`(`id`) ON UPDATE no action ON DELETE no action,
	FOREIGN KEY (`coach1_season_id`) REFERENCES `season_coaches`(`id`) ON UPDATE no action ON DELETE no action,
	FOREIGN KEY (`coach2_season_id`) REFERENCES `season_coaches`(`id`) ON UPDATE no action ON DELETE no action,
	FOREIGN KEY (`winner_id`) REFERENCES `season_coaches`(`id`) ON UPDATE no action ON DELETE no action
);
CREATE TABLE `pokemon` (
	`id` integer PRIMARY KEY AUTOINCREMENT NOT NULL,
	`name` text NOT NULL,
	`sprite_url` text,
	`types` text
, `pokedex_id` integer, `artwork_url` text, `hp` integer, `attack` integer, `defense` integer, `special_attack` integer, `special_defense` integer, `speed` integer, `base_stat_total` integer, `display_name` text);
CREATE TABLE `rosters` (
	`id` integer PRIMARY KEY AUTOINCREMENT NOT NULL,
	`season_coach_id` integer NOT NULL,
	`pokemon_id` integer NOT NULL,
	`price` integer NOT NULL,
	`draft_order` integer, `is_tera_captain` integer DEFAULT false, `acquired_week` integer, `acquired_via` text, `acquired_transaction_id` integer,
	FOREIGN KEY (`season_coach_id`) REFERENCES `season_coaches`(`id`) ON UPDATE no action ON DELETE no action,
	FOREIGN KEY (`pokemon_id`) REFERENCES `pokemon`(`id`) ON UPDATE no action ON DELETE no action
);
CREATE TABLE `season_coaches` (
	`id` integer PRIMARY KEY AUTOINCREMENT NOT NULL,
	`coach_id` integer NOT NULL,
	`division_id` integer NOT NULL,
	`team_name` text NOT NULL,
	`is_active` integer DEFAULT true,
	`replaced_by_id` integer,
	`remaining_budget` integer, `team_abbreviation` text, `team_logo_url` text,
	FOREIGN KEY (`coach_id`) REFERENCES `coaches`(`id`) ON UPDATE no action ON DELETE no action,
	FOREIGN KEY (`division_id`) REFERENCES `divisions`(`id`) ON UPDATE no action ON DELETE no action
);
CREATE TABLE `season_pokemon_prices` (
	`id` integer PRIMARY KEY AUTOINCREMENT NOT NULL,
	`season_id` integer NOT NULL,
	`pokemon_id` integer NOT NULL,
	`price` integer NOT NULL, `tera_banned` integer DEFAULT false, `tera_captain_cost` integer, `complex_ban_reason` text,
	FOREIGN KEY (`season_id`) REFERENCES `seasons`(`id`) ON UPDATE no action ON DELETE no action,
	FOREIGN KEY (`pokemon_id`) REFERENCES `pokemon`(`id`) ON UPDATE no action ON DELETE no action
);
CREATE TABLE `seasons` (
	`id` integer PRIMARY KEY AUTOINCREMENT NOT NULL,
	`name` text NOT NULL,
	`start_date` text,
	`end_date` text,
	`is_current` integer DEFAULT false,
	`draft_budget` integer DEFAULT 100
, `is_public` integer DEFAULT true, `season_number` integer DEFAULT 1 NOT NULL);
CREATE TABLE `transactions` (
	`id` integer PRIMARY KEY AUTOINCREMENT NOT NULL,
	`season_id` integer NOT NULL,
	`type` text NOT NULL,
	`week` integer NOT NULL,
	`season_coach_id` integer NOT NULL,
	`team_abbreviation` text,
	`trading_partner_season_coach_id` integer,
	`trading_partner_abbreviation` text,
	`pokemon_in` text,
	`pokemon_out` text,
	`new_tera_captain_id` integer,
	`old_tera_captain_id` integer,
	`budget_change` integer DEFAULT 0,
	`counts_against_limit` integer DEFAULT true,
	`notes` text,
	`created_at` text DEFAULT 'CURRENT_TIMESTAMP',
	FOREIGN KEY (`season_id`) REFERENCES `seasons`(`id`) ON UPDATE no action ON DELETE no action,
	FOREIGN KEY (`season_coach_id`) REFERENCES `season_coaches`(`id`) ON UPDATE no action ON DELETE no action,
	FOREIGN KEY (`trading_partner_season_coach_id`) REFERENCES `season_coaches`(`id`) ON UPDATE no action ON DELETE no action,
	FOREIGN KEY (`new_tera_captain_id`) REFERENCES `pokemon`(`id`) ON UPDATE no action ON DELETE no action,
	FOREIGN KEY (`old_tera_captain_id`) REFERENCES `pokemon`(`id`) ON UPDATE no action ON DELETE no action
);
CREATE TABLE IF NOT EXISTS "playoff_matches" (
	`id` integer PRIMARY KEY AUTOINCREMENT NOT NULL,
	`season_id` integer NOT NULL,
	`division_id` integer NOT NULL,
	`round` integer NOT NULL,
	`bracket_position` integer NOT NULL,
	`higher_seed_id` integer,
	`lower_seed_id` integer,
	`winner_id` integer,
	`higher_seed_wins` integer DEFAULT 0,
	`lower_seed_wins` integer DEFAULT 0,
	`played_at` text,
	`match_id` integer,
	FOREIGN KEY (`season_id`) REFERENCES `seasons`(`id`) ON UPDATE no action ON DELETE no action,
	FOREIGN KEY (`division_id`) REFERENCES `divisions`(`id`) ON UPDATE no action ON DELETE no action,
	FOREIGN KEY (`higher_seed_id`) REFERENCES `season_coaches`(`id`) ON UPDATE no action ON DELETE no action,
	FOREIGN KEY (`lower_seed_id`) REFERENCES `season_coaches`(`id`) ON UPDATE no action ON DELETE no action,
	FOREIGN KEY (`winner_id`) REFERENCES `season_coaches`(`id`) ON UPDATE no action ON DELETE no action,
	FOREIGN KEY (`match_id`) REFERENCES `matches`(`id`) ON UPDATE no action ON DELETE no action
);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX `pokemon_name_unique` ON `pokemon` (`name`);
COMMIT;
